import React from 'react'
import { Sparklines, SparklinesLine } from 'react-sparklines';
import TimeAgo from 'react-timeago'

class ExchangeRow extends React.Component {

  render() {
    return (
      <tr >
        <td>{this.props.exchange_name.toUpperCase()}</td>
        <td>
          {this.props.exchange_name.toUpperCase()}
        </td>
        <td>
          {this.props.exchange_name.toUpperCase()}
        </td>
        <td>
          {this.props.exchange_name.toUpperCase()}
        </td>
        <td >
          {this.props.exchange_name.toUpperCase()}
        </td>
        <td >
          {this.props.exchange_name.toUpperCase()}
        </td>

        <td>
          <Sparklines data={history.map((history) => { return history.value})}>
            <SparklinesLine color="blue" />
          </Sparklines>
        </td>
        <td className='updated_at'>
          <TimeAgo date={ history.slice(-1)[0].time } />
        </td>
      </tr>
    );
  }
}

export default ExchangeRow;
